import React from 'react';
import {BrowserRouter as Router, Link} from "react-router-dom"

const Public = ()=> <h3>public</h3>
const Protected = ()=> <h3>Protected</h3>


function Login() {

  return (
    <div>
        Login
    </div>
  )
}


function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to ="/">Home</Link>
            </li>
            <li>
              <Link to ="/about">About</Link>
            </li>
            <li>
              <Link to ="/users">users</Link>
            </li>
          </ul>
        </nav>
      </div>
    </Router>
  );
}

export default App;
